// Vehiculos.jsx
export default function Vehiculos() {
  const opcionesServicio = [
    "Cambio de aceite y filtro",
    "Revisión de frenos",
    "Revisión de suspensión",
    "Cambio de llantas",
    "Revisión general",
  ];

  return (
    <div className="p-6 flex flex-col items-center">
      <h1 className="text-3xl font-bold mb-6 text-gray-800">Registrar Servicio de Vehículo</h1>

      <div className="bg-white border border-gray-200 rounded-xl shadow-sm p-6 w-full max-w-md flex flex-col gap-4">
        <input type="text" placeholder="Placa" className="border border-gray-300 rounded p-2" />
        <input type="text" placeholder="Color" className="border border-gray-300 rounded p-2" />
        <input type="number" placeholder="Año" className="border border-gray-300 rounded p-2" />
        <input type="number" placeholder="Kilometraje" className="border border-gray-300 rounded p-2" />
        <input type="text" placeholder="Responsable" className="border border-gray-300 rounded p-2" />
        <select className="border border-gray-300 rounded p-2">
          <option value="">Próximo servicio</option>
          {opcionesServicio.map((opcion, index) => (
            <option key={index} value={opcion}>
              {opcion}
            </option>
          ))}
        </select>
        <button
          type="button"
          className="bg-green-600 text-white rounded p-2 hover:bg-green-700 transition"
        >
          Guardar Vehículo
        </button>
      </div>
    </div>
  );
}
